<title>WinSCP密钥设置_winscp ppk_清风木子云的博客-CSDN博客</title>

<meta name=description content="1、打开WinSCP选择要编辑的连接，选择高级设置2、选中ssh->验证3、选择保存在本机.ssh目录下的密钥，记得选择所有文件4、选中id_rsa密钥文件5、选中id_rsa密钥文件之后winscp会自动转成.ppk文件，并且保存至.ssh/目录下6、点击确定7、点击确定，之后双击连接就可以连上了..._winscp ppk">
